import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <header>
        <Routes>
          <Route path="/" element={<h1>Titulo a</h1>}></Route>
          <Route path="/a" element={<h1>Titulo a</h1>}></Route>
          <Route path="/C" element={<h1>Titulo a</h1>}></Route>
        </Routes>
      </header>
      <main>
        <Routes>
          <Route path="/" element={<h1>Inicial a</h1>}></Route>
          <Route path="/a" element={<h1>Titulo a</h1>}></Route>
          <Route path="/C" element={<h1>Titulo a</h1>}></Route>
          <Route path="/*" element={<h1>Not Found</h1>}></Route>
        </Routes>
      </main>
    </BrowserRouter>
  );
}

export default App;
